import React from 'react';
import {
  Dropdown,
  DropdownToggle,
  DropdownMenu,
  DropdownItem
} from 'reactstrap';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faBolt, faToolbox } from '@fortawesome/free-solid-svg-icons';
export default class Example extends React.Component {
  constructor(props) {
    super(props);

    this.toggle = this.toggle.bind(this);
    this.state = {
      dropdownOpen: false
    };
  }

  toggle() {
    this.setState(prevState => ({
      dropdownOpen: !prevState.dropdownOpen
    }));
  }

  render() {
    return (
      <Dropdown
        style={
          {
            //   height: '20%',
            //   width: '40%',
            //   background: 'yellow'
            //   background: 'blue',
            //   background: 'blue'
          }
        }
        isOpen={this.state.dropdownOpen}
        toggle={this.toggle}
        id="dropdown1"
      >
        {' '}
        <h3> Stun</h3> <FontAwesomeIcon className=" fa-3x" icon={faBolt} />
        <DropdownToggle id="show-stunners" caret />
        <DropdownMenu>
          <DropdownItem header>Head Slam (default)</DropdownItem>
          {/* <DropdownItem divider /> */}
          <DropdownItem>Club or Poleaxe</DropdownItem>
          <DropdownItem>Slaughtering Mask</DropdownItem>
          <DropdownItem>Gas Chamber</DropdownItem>
        </DropdownMenu>
      </Dropdown>
    );
  }
}
